import React, { Component } from 'react'
// @Components
import {
  CButton,
  CModal,
  CModalBody,
  CModalFooter,
  CModalHeader,
  CModalTitle,
} from "@coreui/react";

export default class Group extends Component {
  render() {
    const {modal, onCloseModal, group} = this.props;
    console.log(group)
    return (
      <CModal show={modal} onClose={() => onCloseModal("_modal",!modal)} closeOnBackdrop={false}>
        <CModalHeader closeButton>
          <CModalTitle>
            Nhóm sản phẩm {group._id}
          </CModalTitle>
        </CModalHeader>
        <CModalBody>

        </CModalBody>
        <CModalFooter>
          <CButton color="secondary" onClick={() => onCloseModal("_modal",!modal)}>
            Cancel
          </CButton>
        </CModalFooter>
      </CModal>
    )
  }
}
